import React from 'react';
import SideBarItem from './SideBarItem/SideBarItem';
import {Menu, Divider} from 'semantic-ui-react';
import './SideBar.scss';
import {SideBarHeader} from './SideBarHeader/SideBarHeader';

import {SideBarFooter} from './SideBarFooter/SideBarFooter';

export class SideBar extends React.Component {
  render() {
    return (
      <Menu borderless vertical stackable fixed='right' className='side-nav'>
        <SideBarItem path='/' label='Home' icon='home'/>
        <Divider/>
        <SideBarHeader title='Lessons'/>
        <SideBarItem label='History' icon='history'/>
        <SideBarItem label='Watch later' icon='clock'/>
        <SideBarItem label='Liked Lessons' icon='thumbs up'/>
        <Divider/>
        <SideBarItem label='' icon='film'/>
      </Menu>
    );
  }
}
